class Introduction extends React.Component{
  constructor(props){
    super(props);
    this.state = {description: "test"};
  }

  componentDidMount(){
    this.state.description = "hiii";
  }
  render(){
    return(
      <div className="intro">s
        <h1 className="intro-text">
          <TypeWriter typing={1} delayMap={delays}>
            Hi,<br/> I'm Eva Hiew,
          </TypeWriter>
        </h1>
        <h1>{this.state.description}</h1>
        <img src={profilepic} className="intro-img" alt="pic"/>
      </div>
    );
  }
}

function App() {
  return (
    <div className="homepage">
    <Introduction/>
    </div>
  );
}

